import logo from "./images/logo.png"
import './App.css';
import Homepage from "./Components/HOME"
import top50 from "./images/top50 global.jpg"
let arrayofimages = ["https://s.hdnux.com/photos/01/07/27/40/18708492/3/920x920.jpg",
"https://media1.giphy.com/media/L46AFxg1FQrdzKYSpz/giphy.gif",
"https://images.firstpost.com/wp-content/uploads/2020/12/Spotify_Wrapped.jpg",
"https://i.scdn.co/image/ab67706c0000bebbb6964d461dd1eb8d0661eea5",
"https://routenote.com/blog/wp-content/uploads/2020/08/Global-Top-50.jpg"]

function App() {
  return (
    <div>
      <header>
      <ul>
        <li><img src={logo} style={{"height":"50px","width":"50px"}}/></li>
        <li>HOME</li>
        <li>ABOUT US</li>
        <li>PRICING</li>
      </ul>
          <img src={top50} style={{"height":"100px", "width":"100px"}}/>

      </header>


            {/* <Homepage/> */}
    </div>
  );
}

export default App;
